import React, {Component} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
class AuthPage extends Component {
    render() {
        return (
            <div style={{
                background: 'url(\'img/background.svg\')',
                backgroundSize: 'cover',
                width: '100%',
                height: '100%'}}>
                <h1>DSDADSADWA</h1>
            </div>
        )
    }}

    export default AuthPage
